import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
  return (
<ul>
  <li>Learn react</li>
  <li>Build Awesome App</li>
</ul>
  );
};

const AppHeader = () => {
  return(
    <h1>My Todo List</h1>
  );
};

const searchPanel = () =>{
  return     <input placeholder='search' />
}
const el = (
  <div>
    <AppHeader/>
<TodoList />
  </div>
);
ReactDOM.render(el, document.getElementById('root'));
